import React, { useState } from "react";
import Tour from "./Tour";

const Tours = () => {
  const [show, setShow] = useState(false);
  return (
    <>
      <button
        style={{ margin: "20px" }}
        className="delete-btn"
        onClick={() => setShow(!show)}
      >
        not interested
      </button>
      {show && <Tour />}
    </>
  );
};

export default Tours;
